import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    {
      id: "e1",
      title: "Toilet Paper",
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    { id: "e2", title: "New TV", amount: 799.49, date: new Date(2021, 2, 12) },
    {
      id: "e3",
      title: "Car Insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e4",
      title: "New Desk (Wooden)",
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];

  // console.log('one')

  return (
    <div>

      {expenses.map((objectMy) => (
        <ExpenseItem
          key={objectMy.id}
          title={objectMy.title}
          amount={objectMy.amount}
          date={objectMy.date}
        />
      ))}



      <h1>___Koniec Mapowania___</h1>
      <h2>Drugie Mapowanko</h2>

    </div>
  );
}

export default App;
